class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Intro />
        <About />
        {/* <Services /> */}
        {/* <Testimonial /> */}
        <Work />
        { <Clients /> }
        {/* <Contact /> */}
      </div>
    );
  }
}

export default App;
